		for (int j = 0; j < num.length - 1; j++) {
			if (num[j] > num[j + 1]) // change to > for ascending sort
			{
				temp = num[j]; // swap elements
				num[j] = num[j + 1];
				num[j + 1] = temp;
				flag = true; // shows a swap occurred
